<h1 class="Section4">
<a class="Section5" href="#" id="creation-d-une-icone">Création d'une icône</a>
</h1>
<div class="Section6"><br>Résultat:<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Icône dans la barre des tâches:<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Programme C++:<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
// main.cpp
//===============================================
int main(int _argc, char** _argv) {
    QApplication lApp(_argc, _argv);
    lApp.setWindowIcon(QIcon(":/img/icon.ico"));

    QGraphicsView* lView = new QGraphicsView;
    lView-&gt;setWindowTitle("ReadyGaming");
    lView-&gt;show();

    return lApp.exec();
}
//===============================================</pre><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="dimensionnement-de-la-scene">Dimensionnement de la scène</a>
</h1>
<div class="Section6"><br>Résultat:<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Programme C++:<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
// main.cpp
//===============================================
int main(int _argc, char** _argv) {
    QApplication lApp(_argc, _argv);
    lApp.setWindowIcon(QIcon(":/img/icon.ico"));

    int lWidth = 1280;
    int lHeight = 720;

    QGraphicsScene* lScene = new QGraphicsScene;

    QGraphicsView* lView = new QGraphicsView;
    lView-&gt;setWindowTitle("ReadyGaming");

    lView-&gt;setScene(lScene);
    lView-&gt;setFocus();
    lView-&gt;setSceneRect(0, 0, lWidth, lHeight);
    lView-&gt;setFixedSize(lWidth + 2, lHeight + 2);

    lView-&gt;show();

    return lApp.exec();
}
//===============================================</pre><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="creation-d-un-fond-d-ecran">Création d'un fond d'écran</a>
</h1>
<div class="Section6"><br>Résultat:<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Programme C++:<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
// main.cpp
//===============================================
int main(int _argc, char** _argv) {
    QApplication lApp(_argc, _argv);
    lApp.setWindowIcon(QIcon(":/img/icon.ico"));

    int lWidth = 1280;
    int lHeight = 720;

    QGraphicsPixmapItem* lBackground = new QGraphicsPixmapItem;
    lBackground-&gt;setPixmap(QPixmap(":/img/background.png"));

    QGraphicsScene* lScene = new QGraphicsScene;
    lScene-&gt;addItem(lBackground);

    QGraphicsView* lView = new QGraphicsView;
    lView-&gt;setWindowTitle("ReadyGaming");

    lView-&gt;setScene(lScene);
    lView-&gt;setFocus();
    lView-&gt;setSceneRect(0, 0, lWidth, lHeight);
    lView-&gt;setFixedSize(lWidth + 2, lHeight + 2);

    lView-&gt;show();

    return lApp.exec();
}
//===============================================</pre><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="animation-du-fond-d-ecran">Animation du fond d'écran</a>
</h1>
<div class="Section6"><br>Résultat:<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Programme C++:<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
// main.cpp
//===============================================
int main(int _argc, char** _argv) {
    QApplication lApp(_argc, _argv);
    lApp.setWindowIcon(QIcon(":/img/icon.ico"));

    int lWidth = 1280;
    int lHeight = 720;

    GAnimation* lBackground = new GAnimation;
    lBackground-&gt;setPixmap(QPixmap(":/img/background.png"));

    QPropertyAnimation* lAnimation = new QPropertyAnimation(lBackground, "pos");
    lAnimation-&gt;setLoopCount(-1);
    lAnimation-&gt;setDuration(150000);
    lAnimation-&gt;setStartValue(QPoint(-lWidth, 0));
    lAnimation-&gt;setEndValue(QPoint(0, 0));
    lAnimation-&gt;start();

    QGraphicsScene* lScene = new QGraphicsScene;
    lScene-&gt;addItem(lBackground);

    QGraphicsView* lView = new QGraphicsView;
    lView-&gt;setWindowTitle("ReadyGaming");

    lView-&gt;setScene(lScene);
    lView-&gt;setFocus();
    lView-&gt;setSceneRect(0, 0, lWidth, lHeight);
    lView-&gt;setFixedSize(lWidth + 2, lHeight + 2);

    lView-&gt;show();

    return lApp.exec();
}
//===============================================
// GAnimation.h
//===============================================
class GAnimation : public QObject, public QGraphicsPixmapItem {
    Q_OBJECT
    Q_PROPERTY(QPointF pos READ pos WRITE setPos)
};
//===============================================</pre><br></div>
</div>
</div>
