</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="ajout-d-un-logo-de-fond">Ajout d'un logo de fond</a>
</h1>
<div class="Section6"><br>Résultat:<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Programme C++:<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
// main.cpp
//===============================================
int main(int _argc, char** _argv) {
    QApplication lApp(_argc, _argv);
    lApp.setWindowIcon(QIcon(":/img/icon.ico"));

    int lWidth = 1280;
    int lHeight = 720;

    GAnimation* lBackground = new GAnimation;
    lBackground-&gt;setPixmap(QPixmap(":/img/background.png"));

    QPropertyAnimation* lAnimation = new QPropertyAnimation(lBackground, "pos");
    lAnimation-&gt;setLoopCount(-1);
    lAnimation-&gt;setDuration(150000);
    lAnimation-&gt;setStartValue(QPoint(-lWidth, 0));
    lAnimation-&gt;setEndValue(QPoint(0, 0));
    lAnimation-&gt;start();

    QGraphicsPixmapItem* lForeground = new QGraphicsPixmapItem(QPixmap(":/img/title.png"));

    QGraphicsPixmapItem* lLogo = new QGraphicsPixmapItem(QPixmap(":/img/logo.png"));
    lLogo-&gt;setPos((lWidth - lLogo-&gt;boundingRect().width()) / 2, lHeight / 12);

    QGraphicsScene* lScene = new QGraphicsScene;
    lScene-&gt;addItem(lBackground);
    lScene-&gt;addItem(lForeground);
    lScene-&gt;addItem(lLogo);

    QGraphicsView* lView = new QGraphicsView;
    lView-&gt;setWindowTitle("ReadyGaming");

    lView-&gt;setScene(lScene);
    lView-&gt;setFocus();
    lView-&gt;setSceneRect(0, 0, lWidth, lHeight);
    lView-&gt;setFixedSize(lWidth + 2, lHeight + 2);

    lView-&gt;show();

    return lApp.exec();
}
//===============================================</pre><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="creation-de-la-scene-d-accueil">Création de la scène d'accueil</a>
</h1>
<div class="Section6"><br>Résultat:<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Programme C++:<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
// main.cpp
//===============================================
int main(int _argc, char** _argv) {
    QApplication lApp(_argc, _argv);
    lApp.setWindowIcon(QIcon(":/img/icon.ico"));

    int lWidth = 1280;
    int lHeight = 720;

    GHome* lHome = new GHome;

    QGraphicsView* lView = new QGraphicsView;
    lView-&gt;setWindowTitle("ReadyGaming");

    lView-&gt;setScene(lHome);
    lView-&gt;setFocus();
    lView-&gt;setSceneRect(0, 0, lWidth, lHeight);
    lView-&gt;setFixedSize(lWidth + 2, lHeight + 2);

    lView-&gt;show();

    return lApp.exec();
}
//===============================================
// GHome.cpp
//===============================================
GHome::GHome(QObject* _parent)
: QGraphicsScene(_parent) {
    int lWidth = 1280;
    int lHeight = 720;

    GAnimation* lBackground = new GAnimation;
    lBackground-&gt;setPixmap(QPixmap(":/img/background.png"));

    QPropertyAnimation* lAnimation = new QPropertyAnimation(lBackground, "pos");
    lAnimation-&gt;setLoopCount(-1);
    lAnimation-&gt;setDuration(150000);
    lAnimation-&gt;setStartValue(QPoint(-lWidth, 0));
    lAnimation-&gt;setEndValue(QPoint(0, 0));
    lAnimation-&gt;start();

    QGraphicsPixmapItem* lForeground = new QGraphicsPixmapItem(QPixmap(":/img/title.png"));

    QGraphicsPixmapItem* lLogo = new QGraphicsPixmapItem(QPixmap(":/img/logo.png"));
    lLogo-&gt;setPos((lWidth - lLogo-&gt;boundingRect().width()) / 2, lHeight / 12);

    addItem(lBackground);
    addItem(lForeground);
    addItem(lLogo);
}
//===============================================<br></pre><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="creation-d-une-vue-graphique-principale">Création d'une vue graphique principale</a>
</h1>
<div class="Section6"><br>Résultat:<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Programme C++:<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
// main.cpp
//===============================================
int main(int _argc, char** _argv) {
    QApplication lApp(_argc, _argv);
    lApp.setWindowIcon(QIcon(":/img/icon.ico"));

    GView* lView = new GView;
    lView-&gt;show();

    return lApp.exec();
}
//===============================================
// GView.cpp
//===============================================
GView::GView(QWidget* _parent)
: QGraphicsView(_parent) {
    int lWidth = 1280;
    int lHeight = 720;

    GHome* lHome = new GHome;

    setWindowTitle("ReadyGaming");

    setScene(lHome);
    setFocus();
    setSceneRect(0, 0, lWidth, lHeight);
    setFixedSize(lWidth + 2, lHeight + 2);
}
//===============================================</pre><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="creation-d-un-bouton-connexion-invite">Création d'un bouton connexion invité</a>
</h1>
<div class="Section6"><br>Résultat:<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Résultat de l'appui sur le bouton connexion invité:<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Programme C++:<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
// GView.cpp
//===============================================
GView::GView(QWidget* _parent)
: QGraphicsView(_parent) {
    int lWidth = 1280;
    int lHeight = 720;

    GHome* lHome = new GHome;

    QPushButton* lGuestLogin = new QPushButton(this);
    lGuestLogin-&gt;setText("Connexion invité");
    lGuestLogin-&gt;setToolTip("Connectez-vous en tant qu'invité");
    lGuestLogin-&gt;setGeometry(QRect(540, 535, 100, 32));
    connect(lGuestLogin, SIGNAL(clicked()), this, SLOT(onGuestLogin()));

    setWindowTitle("ReadyGaming");

    setScene(lHome);
    setFocus();
    setSceneRect(0, 0, lWidth, lHeight);
    setFixedSize(lWidth + 2, lHeight + 2);
}
//===============================================
void GView::onGuestLogin() {
    printf("%s...\n", __FUNCTION__);
}
//===============================================</pre><br></div>
